import binascii

input_d = b''
new = b''


def cast_hexbytes_uint8(data):
	output_data = []
	info = [data[i:i+2] for i in range(0, len(data), 2)]
	for elem in info:
		output_data.append((int(binascii.unhexlify(elem).hex(), base=16)))
	return output_data


print(input_d)
output = cast_hexbytes_uint8(new)
print(output)

